export const initIcons = (icons: KeyedObject<JSX.Element>) => {
  Object.assign(iconsList, icons);
}

export type IconComponentPropsType = {
  name: string,
  className?: string,
  tag?: string,
  style?: KeyedObject
}

export class Icon extends Component<IconComponentPropsType, {}> {
  getIcon(name: string) {
    return iconsList[name];
  }

  render() {
    const {
      name,
      className,
      tag,
      ...rest
    } = this.props;
    const cls = classNames("icon", className);
    const Tag: any = (typeof tag !== "undefined") ? tag : "div";

    return (
      <Tag className={cls} {...rest}>
        <canvas width="1" height="1" />
        {this.getIcon(name)}
      </Tag>
    );
  }
}
